// SPDX-License-Identifier: MIT
pragma solidity ^0.8.6;

contract Console {
    event LogUint(string, uint256);

    function log(string calldata s, uint256 x) public {
        emit LogUint(s, x);
    }

    event LogInt(string, int256);

    function log(string calldata s, int256 x) public {
        emit LogInt(s, x);
    }

    event LogBytes(string, bytes);

    function log(string calldata s, bytes calldata x) public {
        emit LogBytes(s, x);
    }

    event LogBytes32(string, bytes32);

    function log(string calldata s, bytes32 x) public {
        emit LogBytes32(s, x);
    }

    event LogAddress(string, address);

    function log(string calldata s, address x) public {
        emit LogAddress(s, x);
    }

    event LogBool(string, bool);

    function log(string calldata s, bool x) public {
        emit LogBool(s, x);
    }
}

